import React from "react";
import Home from "./Components/project12/Home";
import LoginPage from "./Components/project12/LoginPage";
import { Routes, Route } from "react-router-dom";
import DataPage from "./Components/project12/DataPage";
// import Home from "./pratice-9/Home";
// import Navbar from "./pratice-9/Navbar";
// import About from "./pratice-9/About";
// import Contact from "./pratice-9/Contact";
function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/loginpage" element={<LoginPage />} />
        <Route path="/data" element={<DataPage />} />
      </Routes>
    </>
  );
}

export default App;
